import React from "react";
import ToDoListItem from './to-do-list-item'

let ToDoList = ({todos}) => {
    let elements = todos.map((item) => {
        return <li important={item.important}>{item.label}</li>;
    });
    return (
        <ul>
            <li><ToDoListItem /></li>
            <li><ToDoListItem /></li>
            <li><ToDoListItem /></li>
        </ul>
    )
};
export default ToDoList
